Jesuit inscription on title page dated 1616 recording provenance from the library of Jesuit College in Olmütz: &quot;Collegij Olomucen[sis] Soc[ieta]tis Jesu&quot;  (now Palacký University of Olomouc)? Cf. <a href="http://en.wikipedia.org/wiki/Palack%c3%bd_University_of_Olomouc" rel="nofollow">en.wikipedia.org/wiki/Palack%C3%BD_University_of_Olomouc</a>

