Ownership inscription followed by shelf/catalog designation(?) &quot; [...][ Aris.? philos. num. 113&quot;

Ownership inscription &quot;Sum Nicolai à Montenach.&quot;

Possibly Bishop Joseph Nicolas de Montenach, 1709-1782, born in Fribourg and bishop of Lausanne, Switzerland (other two ownership inscriptions in this book are also Swiss).  

No established heading for him.

Inscribed &quot;Wodehouse / Kimberly 1838&quot;

Bookplate of the Wodehouse family of Kimberley, Norfolk
Cf Franks 32313

Bookplate of Henri Lambert, avocat Versailles, with motto &quot;Amor et labor&quot;
Jean-Baptiste-Joseph-Henry Lambert (1827-1880), owner of a library and a collection of paintings, drawings, autographs, manuscripts, objects of art, medals etc.
He is established as: <a href="http://viaf.org/processed/LC|no2008044564" rel="nofollow">Lambert Lassus, Henry,‏ ‎ 1827-1880‏ </a>

Ms. ownership inscription from the Jesuit College in Paris: &quot;Collegii Paris[iensis] Societatis Jesu&quot;
Founded by the Jesuits in 1560 as Collège de Clermont; name changed to Collège Louis-le-Grand in 1682; suppressed in 1762.
Established heading:  <a href="http://id.loc.gov/authorities/names/no97037604.html" rel="nofollow">Collège de Clermont (Paris, France)</a>

